import React , { useState }  from 'react'
import  'isomorphic-unfetch'
import Cookies from 'js-cookie';

import { API } from '../config';


const Testpage = ({pokemon = [], token ,count}) =>(

 
    <div>
       {console.log(pokemon)}
       {console.log(token)}
      ss<h2>POKEMON FOREST  </h2>
        <ul className="list">
          {pokemon.map(pokemon => {
           
            return (
              <li key={pokemon.name} >
                <span>{pokemon.sprites.front_default} </span>
                
              </li>
            )
          })}
        </ul>
    </div>
)



Testpage.getInitialProps = fetchData;

async function fetchData() {
  
  const token = Cookies.get('token')
  const initialURL = `${API}/pokedex/add`;
  const header = {headers: {
    Accept: 'application/json',
    Authorization: 'Bearer '+token,
}}
  
  const fetchRes = await fetch(initialURL, header)
  const res = await fetchRes.json()
  

  console.log(res.data)
  return {
    pokemon: res.data,
    token
  }
}

  export default Testpage
